import React from "react";
import Entry from "./Entry.jsx";
import emojipedia from "../emojipedia.js";


function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
          {emojipedia.map(function(emojis){
              <Entry 
                  icon = {emojis.emoji}
                  name = {emojis.name}
                  detail = {emojis.meaning}
                  /> 
          })
           }

    </div>
  );
}

export default App;
